  {
   "cell_type": "code",
   "execution_count": 46,
   "metadata": {},
   "outputs": [],
   "source": [
    "#Time for Polynomial Fit\n",
    "from sklearn.preprocessing import PolynomialFeatures\n",
    "from sklearn import linear_model\n",
    "from sklearn.metrics import mean_squared_error, r2_score, mean_absolute_error, mean_squared_log_error, median_absolute_error\n"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 38,
   "metadata": {},
   "outputs": [],
   "source": [
    "#Need to fit some poly stuff\n",
    "\n",
    "#first create X feature vector of [GHI, Cloud Cover]\n",
    "_GHI = df1_2018['GHI'].values\n",
    "_Cloud_Cover = df1_2018['Cloud Cover'].values\n",
    "_X = np.array(list(zip(_GHI, _Cloud_Cover)))"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 40,
   "metadata": {},
   "outputs": [
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "4494\n"
     ]
    }
   ],
   "source": [
    "poly = PolynomialFeatures(degree=5)\n",
    "X_poly = poly.fit_transform(_X)\n",
    "print(len(X_poly))\n",
    "log_actuals = df1_2018['DHI_log']"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 41,
   "metadata": {},
   "outputs": [],
   "source": [
    "clf_poly = linear_model.LinearRegression()\n",
    "clf_poly.fit(X_poly, log_actuals)\n",
    "predictions_poly = clf_poly.predict(X_poly)"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 43,
   "metadata": {},
   "outputs": [
    {
     "data": {
      "image/png": "\n",
      "text/plain": [
       "<Figure size 432x288 with 1 Axes>"
      ]
     },
     "metadata": {},
     "output_type": "display_data"
    }
   ],
   "source": [
    "def viz_linear():\n",
    "    plt.scatter(_GHI, log_actuals, color='red')\n",
    "    plt.plot(_GHI, predictions_poly, color='blue')\n",
    "    plt.title('Poly Fit')\n",
    "    plt.xlabel('GHI')\n",
    "    plt.ylabel('DHI_log')\n",
    "    plt.show()\n",
    "    return\n",
    "viz_linear()"
   ]
  },
